import React, { Component } from 'react';

class Index extends Component {
    render() {
        return(
            <div id='customers'>
                <p id='firstname'>First name {this.props.customers.first_name}</p>
                <p id='lastname'>Last name {this.props.customers.last_name}</p>
                <p id='homecity'>Home city {this.props.customers.home_city}</p>
            </div>

        )
    }   
}

export default Index;
